column8:
◆自転車いじりにあると便利なノギス。<BR>
・デジタル液晶表示で見やすくて使いやすい。<BR>
・電池はLR44を1個使用（付属）。<BR>
<BR>
・ハンドル径やパイプ径の内径・外径の両方測定可能。<BR>
<BR>
◆仕様
・ミリ／インチ切り替え。<BR>
・デジタル液晶。<BR>
・外径、内径、深さの測定。<BR>
・LR44ボタン電池（付属）。<BR>
・本体カーボンコンポジット製。<BR>
<BR>
◆定形外郵便　全国送料無料。<BR>
・24時間以内に発送。<BR>
※パッケージなし、電池入り本体をプチプチにくるんで封筒で発送いたします。<BR>
